import { LogBox, StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
  container: {
    flex: 1,
    width:1080,
    height:1000,
    alignItems: 'center'
  },
  logo: {
    width: 214,
    height:120,
    marginTop:74,
    marginBottom: 48
  },
  contentList: {
    paddingLeft: 32,
    paddingRight:64,
  }
});
